  PRIMARY KEY  (`adminmessageid`),
  KEY `script_action` (`script`,`action`),
  KEY `varname` (`varname`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS adminutil;
